import React from "react"

function Footer() {
    return(
      <React.Fragment>
        <footer>
  <p>Author: Hege Refsnes</p>
  <a href="mailto:hege@example.com">hege@example.com</a>
</footer>
      </React.Fragment>      
    );
}

export default Footer;
